INSERT INTO public.expertise_test_question VALUES (1, 'mcq', 'easy', 'What is a bounding box in object detection?', '', '{}', '["A 3D representation of an object", "A rectangular region that encloses an object", "A pixel-level mask of an object", "A line connecting object centers"]', '1', 2, false, 'A bounding box is a rectangular region defined by coordinates that encloses the object of interest.', true, '2026-02-06 03:29:44.431303+00', '2026-02-06 03:29:44.431315+00', 1, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (2, 'mcq', 'medium', 'Which annotation type is most suitable for counting objects in a crowded scene?', '', '{}', '["Semantic segmentation", "Point annotations", "Image-level classification", "Image captioning"]', '1', 3, false, 'Point annotations (one point per object) are efficient for counting in crowded scenes where bounding boxes would overlap significantly.', true, '2026-02-06 03:29:44.439788+00', '2026-02-06 03:29:44.439801+00', 1, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (3, 'mcq', 'medium', 'What is the difference between semantic and instance segmentation?', '', '{}', '["Semantic segmentation is faster", "Instance segmentation distinguishes between individual objects of the same class", "Semantic segmentation uses bounding boxes", "Instance segmentation only works with medical images"]', '1', 3, false, 'Instance segmentation identifies each individual object separately, while semantic segmentation groups all pixels of the same class together.', true, '2026-02-06 03:29:44.445964+00', '2026-02-06 03:29:44.445975+00', 1, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (4, 'mcq', 'hard', 'When annotating partially occluded objects, what is the best practice?', '', '{}', '["Skip the object entirely", "Only annotate the visible portion", "Annotate the full estimated extent of the object", "Mark it as ''unclear''"]', '2', 4, false, 'Best practice is to annotate the full estimated extent of the object, as this provides the most useful training data for models to learn about occluded objects.', true, '2026-02-06 03:29:44.452149+00', '2026-02-06 03:29:44.45216+00', 1, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (5, 'true_false', 'easy', 'In image classification, each image can only have one label.', '', '{}', '["True", "False"]', '1', 2, false, 'This is false. Multi-label classification allows multiple labels per image.', true, '2026-02-06 03:29:44.458899+00', '2026-02-06 03:29:44.458911+00', 1, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (6, 'mcq', 'easy', 'What does DICOM stand for?', '', '{}', '["Digital Imaging and Communications in Medicine", "Digital Image Compression Method", "Diagnostic Imaging Computer Output Module", "Digital Integrated Clinical Output Management"]', '0', 2, false, 'DICOM stands for Digital Imaging and Communications in Medicine - the international standard for medical images.', true, '2026-02-06 03:29:44.465577+00', '2026-02-06 03:29:44.465589+00', 2, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (7, 'mcq', 'medium', 'When annotating a chest X-ray, which anatomical structure appears brightest (most radiopaque)?', '', '{}', '["Lungs", "Heart", "Bones (ribs, spine)", "Soft tissue"]', '2', 3, false, 'Bones appear brightest on X-rays because they are most radiopaque (block X-rays most effectively).', true, '2026-02-06 03:29:44.473253+00', '2026-02-06 03:29:44.473264+00', 2, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (8, 'mcq', 'hard', 'What is the Hounsfield Unit (HU) scale used for?', '', '{}', '["Measuring image resolution in MRI", "Quantifying tissue density in CT scans", "Calibrating ultrasound machines", "Measuring magnetic field strength"]', '1', 4, false, 'Hounsfield Units are used in CT imaging to quantify radiodensity. Water is 0 HU, air is -1000 HU, and bone is typically +400 to +1000 HU.', true, '2026-02-06 03:29:44.480561+00', '2026-02-06 03:29:44.480601+00', 2, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (9, 'mcq', 'medium', 'Why is patient de-identification important in medical image annotation?', '', '{}', '["To reduce file size", "To improve image quality", "To protect patient privacy (HIPAA compliance)", "To enable faster processing"]', '2', 3, false, 'De-identification is crucial to protect patient privacy and comply with regulations like HIPAA.', true, '2026-02-06 03:29:44.487082+00', '2026-02-06 03:29:44.487094+00', 2, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (10, 'mcq', 'easy', 'What is Named Entity Recognition (NER)?', '', '{}', '["Translating text between languages", "Identifying entities like people, places, organizations in text", "Summarizing long documents", "Checking grammar and spelling"]', '1', 2, false, 'NER identifies and classifies named entities in text into predefined categories.', true, '2026-02-06 03:29:44.494751+00', '2026-02-06 03:29:44.494763+00', 3, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (11, 'mcq', 'medium', 'In sentiment analysis, a text saying ''The product is not bad'' should typically be classified as:', '', '{}', '["Strongly negative", "Negative", "Neutral to slightly positive", "Strongly positive"]', '2', 3, false, '''Not bad'' is a litotes (understatement) that typically conveys slightly positive sentiment.', true, '2026-02-06 03:29:44.502545+00', '2026-02-06 03:29:44.502556+00', 3, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (12, 'mcq', 'medium', 'What is tokenization in NLP?', '', '{}', '["Encrypting text data", "Breaking text into smaller units (words, subwords, characters)", "Translating text to numbers", "Removing punctuation"]', '1', 3, false, 'Tokenization splits text into tokens (words, subwords, or characters) for processing.', true, '2026-02-06 03:29:44.508523+00', '2026-02-06 03:29:44.508534+00', 3, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (13, 'mcq', 'hard', 'What is coreference resolution?', '', '{}', '["Finding synonyms in text", "Linking pronouns and mentions to the entities they refer to", "Detecting duplicate sentences", "Measuring text similarity"]', '1', 4, false, 'Coreference resolution identifies when different expressions refer to the same entity (e.g., ''John'' and ''he'').', true, '2026-02-06 03:29:44.51359+00', '2026-02-06 03:29:44.513602+00', 3, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (14, 'mcq', 'easy', 'What is speaker diarization?', '', '{}', '["Converting speech to text", "Segmenting audio by who is speaking", "Removing background noise", "Adjusting audio volume"]', '1', 2, false, 'Speaker diarization segments audio to identify ''who spoke when''.', true, '2026-02-06 03:29:44.521317+00', '2026-02-06 03:29:44.521327+00', 4, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (15, 'mcq', 'medium', 'When transcribing audio, how should unclear speech be handled?', '', '{}', '["Skip it entirely", "Guess the most likely words", "Mark it with a convention like [inaudible] or [unclear]", "Replace with silence indicators"]', '2', 3, false, 'Standard practice is to mark unclear speech with conventions like [inaudible] rather than guessing.', true, '2026-02-06 03:29:44.527437+00', '2026-02-06 03:29:44.527448+00', 4, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (16, 'mcq', 'medium', 'What information should timestamps in audio transcription typically include?', '', '{}', '["Only start time", "Only end time", "Both start and end times", "Timestamps are not needed"]', '2', 3, false, 'Both start and end times are typically needed for accurate alignment and playback.', true, '2026-02-06 03:29:44.533235+00', '2026-02-06 03:29:44.533247+00', 4, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (17, 'mcq', 'easy', 'What is temporally consistent annotation in video?', '', '{}', '["Annotating every frame independently", "Ensuring annotations are consistent across frames for the same object", "Only annotating keyframes", "Using the same color for all annotations"]', '1', 2, false, 'Temporal consistency means the same object should have consistent IDs and labels across frames.', true, '2026-02-06 03:29:44.541057+00', '2026-02-06 03:29:44.541068+00', 5, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (18, 'mcq', 'medium', 'What is interpolation in video annotation?', '', '{}', '["Deleting annotations", "Automatically generating annotations between keyframes", "Converting video to images", "Changing annotation colors"]', '1', 3, false, 'Interpolation automatically creates annotations for frames between manually annotated keyframes.', true, '2026-02-06 03:29:44.547968+00', '2026-02-06 03:29:44.547979+00', 5, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (19, 'mcq', 'hard', 'When should you create a new track ID for an object in video annotation?', '', '{}', '["Every time the object moves", "When the object is temporarily occluded", "When the object leaves and re-enters the scene", "At regular intervals"]', '2', 4, false, 'A new track ID is typically created when an object completely leaves the scene and returns, as continuity cannot be guaranteed.', true, '2026-02-06 03:29:44.554505+00', '2026-02-06 03:29:44.554518+00', 5, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (20, 'mcq', 'easy', 'What is intent classification in conversational AI?', '', '{}', '["Measuring conversation length", "Identifying what the user wants to accomplish", "Counting words in messages", "Detecting language type"]', '1', 2, false, 'Intent classification identifies the user''s goal (e.g., book a flight, check weather).', true, '2026-02-06 03:29:44.561823+00', '2026-02-06 03:29:44.561834+00', 6, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (21, 'mcq', 'medium', 'What are slot values in a dialog system?', '', '{}', '["The timing of responses", "Specific pieces of information needed to fulfill an intent", "The number of turns in a conversation", "Error messages"]', '1', 3, false, 'Slots are the specific parameters needed (e.g., for ''book flight'': departure_city, arrival_city, date).', true, '2026-02-06 03:29:44.568912+00', '2026-02-06 03:29:44.568924+00', 6, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (22, 'mcq', 'easy', 'What is RLHF in the context of AI training?', '', '{}', '["Random Learning from Hardware", "Reinforcement Learning from Human Feedback", "Recursive Language Handling Framework", "Real-time Learning for Hardware"]', '1', 2, false, 'RLHF uses human preferences to fine-tune AI models.', true, '2026-02-06 03:29:44.57597+00', '2026-02-06 03:29:44.575981+00', 7, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (23, 'mcq', 'medium', 'When evaluating AI-generated text, which of these is NOT typically a quality criterion?', '', '{}', '["Factual accuracy", "Coherence and fluency", "Processing speed", "Relevance to prompt"]', '2', 3, false, 'Processing speed is a system metric, not a text quality criterion.', true, '2026-02-06 03:29:44.582088+00', '2026-02-06 03:29:44.582099+00', 7, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (24, 'mcq', 'hard', 'In preference ranking for RLHF, why is it important to have consistent criteria?', '', '{}', '["To make annotation faster", "To reduce the number of comparisons needed", "To ensure the model learns coherent preferences without conflicting signals", "To minimize storage requirements"]', '2', 4, false, 'Consistent criteria prevent contradictory training signals that could confuse the model.', true, '2026-02-06 03:29:44.58863+00', '2026-02-06 03:29:44.588641+00', 7, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (25, 'mcq', 'easy', 'What is a key-value pair in document parsing?', '', '{}', '["A password and username combination", "A field name paired with its content (e.g., ''Date: 01/01/2024'')", "A row in a spreadsheet", "An image and its caption"]', '1', 2, false, 'Key-value pairs consist of a label (key) and its associated data (value).', true, '2026-02-06 03:29:44.596631+00', '2026-02-06 03:29:44.59665+00', 8, NULL, NULL);
INSERT INTO public.expertise_test_question VALUES (26, 'mcq', 'medium', 'When parsing a receipt, which fields are typically most important to extract?', '', '{}', '["Store logo and colors", "Total amount, date, items, and payment method", "Font type and size", "Paper dimensions"]', '1', 3, false, 'Key fields for receipts include total, date, line items, and payment method.', true, '2026-02-06 03:29:44.605718+00', '2026-02-06 03:29:44.605735+00', 8, NULL, NULL);


